<html lang="en">

<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0" />

    disable-select="true" disable-copy="true" disable-cut="true" disable-paste="true"></script>

  <style>
    @import url('https://fonts.googleapis.com/css2?family=Inter:wght@300;400;500;600;700&display=swap');

    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
    }

    body {
      font-family: 'Inter', -apple-system, BlinkMacSystemFont, sans-serif;
      background: linear-gradient(135deg, #0c0c0c 0%, #1a1a1a 100%);
      color: #ffffff;
      overflow: hidden;
      cursor: default;
      user-select: none;
    }

    .video-container {
      position: fixed;
      top: 0;
      left: 0;
      width: 100vw;
      height: 100vh;
      background: #000;
      z-index: 1;
      display: flex;
      align-items: center;
      justify-content: center;
    }

    video {
      width: 100%;
      height: 100%;
      object-fit: contain;
      background: #000;
    }

    /* Glassmorphism Controls */
    .controls {
      position: fixed;
      bottom: 0;
      left: 0;
      right: 0;
      background: rgba(0, 0, 0, 0.4);
      backdrop-filter: blur(20px) saturate(180%);
      -webkit-backdrop-filter: blur(20px) saturate(180%);
      border-top: 1px solid rgba(255, 255, 255, 0.1);
      display: flex;
      align-items: center;
      justify-content: space-between;
      padding: 1rem 1.5rem;
      z-index: 10;
      opacity: 1;
      transform: translateY(0);
      transition: all 0.4s cubic-bezier(0.4, 0, 0.2, 1);
    }

    .controls.hidden {
      opacity: 0;
      transform: translateY(100%);
      pointer-events: none;
    }

    .controls-left,
    .controls-right {
      display: flex;
      align-items: center;
      gap: 1rem;
    }

    /* Modern Button Styles */
    .control-btn {
      background: rgba(255, 255, 255, 0.1);
      border: 1px solid rgba(255, 255, 255, 0.2);
      color: white;
      cursor: pointer;
      padding: 0.75rem;
      border-radius: 12px;
      transition: all 0.3s cubic-bezier(0.4, 0, 0.2, 1);
      display: flex;
      align-items: center;
      justify-content: center;
      backdrop-filter: blur(10px);
      position: relative;
      overflow: hidden;
    }

    .control-btn::before {
      content: '';
      position: absolute;
      top: 0;
      left: -100%;
      width: 100%;
      height: 100%;
      background: linear-gradient(90deg, transparent, rgba(255, 255, 255, 0.2), transparent);
      transition: left 0.5s;
    }

    .control-btn:hover::before {
      left: 100%;
    }

    .control-btn:hover {
      background: rgba(255, 255, 255, 0.2);
      border-color: rgba(255, 255, 255, 0.3);
      transform: translateY(-2px);
      box-shadow: 0 8px 25px rgba(0, 0, 0, 0.3);
    }

    .control-btn:active {
      transform: translateY(0);
    }

    /* Play/Pause Button - Neon Style */
    .play-pause-btn {
      background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
      border: none;
      width: 3.5rem;
      height: 3.5rem;
      border-radius: 50%;
      display: flex;
      align-items: center;
      justify-content: center;
      cursor: pointer;
      transition: all 0.3s cubic-bezier(0.4, 0, 0.2, 1);
      box-shadow: 0 4px 15px rgba(102, 126, 234, 0.4);
      position: relative;
      overflow: hidden;
    }

    .play-pause-btn::before {
      content: '';
      position: absolute;
      top: -2px;
      left: -2px;
      right: -2px;
      bottom: -2px;
      background: linear-gradient(45deg, #667eea, #764ba2, #667eea);
      border-radius: 50%;
      z-index: -1;
      animation: rotate 3s linear infinite;
      opacity: 0;
      transition: opacity 0.3s;
    }

    .play-pause-btn:hover::before {
      opacity: 1;
    }

    .play-pause-btn:hover {
      transform: scale(1.1);
      box-shadow: 0 6px 20px rgba(102, 126, 234, 0.6);
    }

    @keyframes rotate {
      0% {
        transform: rotate(0deg);
      }

      100% {
        transform: rotate(360deg);
      }
    }

    .play-pause-icon {
      font-size: 1.2rem;
      color: white;
      z-index: 1;
    }

    /* Time Display - Futuristic */
    .time {
      font-size: 0.9rem;
      color: #e0e0e0;
      font-family: 'Inter', monospace;
      font-weight: 500;
      min-width: 140px;
      padding: 0.5rem 1rem;
      background: rgba(255, 255, 255, 0.05);
      border-radius: 8px;
      border: 1px solid rgba(255, 255, 255, 0.1);
      backdrop-filter: blur(10px);
    }

    /* Progress Bar - Neon Glow */
    .progress-container {
      position: absolute;
      bottom: 5rem;
      left: 1.5rem;
      right: 1.5rem;
      height: 6px;
      background: rgba(255, 255, 255, 0.1);
      border-radius: 3px;
      cursor: pointer;
      z-index: 11;
      transition: all 0.4s cubic-bezier(0.4, 0, 0.2, 1);
      backdrop-filter: blur(10px);
    }

    .progress-container.hidden {
      opacity: 0;
      transform: translateY(20px);
      pointer-events: none;
    }

    .progress-container:hover {
      height: 8px;
      bottom: 4.9rem;
    }

    .progress-bar {
      height: 100%;
      background: linear-gradient(90deg, #667eea 0%, #764ba2 50%, #f093fb 100%);
      border-radius: 3px;
      width: 0%;
      position: relative;
      transition: all 0.1s ease;
      box-shadow: 0 0 10px rgba(102, 126, 234, 0.5);
    }

    .progress-handle {
      position: absolute;
      right: -8px;
      top: 50%;
      transform: translateY(-50%);
      width: 16px;
      height: 16px;
      background: #ffffff;
      border-radius: 50%;
      opacity: 0;
      transition: all 0.3s cubic-bezier(0.4, 0, 0.2, 1);
      box-shadow: 0 2px 8px rgba(0, 0, 0, 0.3);
    }

    .progress-container:hover .progress-handle {
      opacity: 1;
      transform: translateY(-50%) scale(1.2);
    }

    /* Back Button - Floating */
    .back-button {
      position: fixed;
      top: 1.5rem;
      left: 1.5rem;
      z-index: 20;
      background: rgba(0, 0, 0, 0.6);
      backdrop-filter: blur(20px);
      color: white;
      border: 1px solid rgba(255, 255, 255, 0.2);
      padding: 0.75rem 1.25rem;
      font-size: 0.9rem;
      font-weight: 500;
      border-radius: 12px;
      cursor: pointer;
      display: flex;
      align-items: center;
      gap: 0.5rem;
      transition: all 0.3s cubic-bezier(0.4, 0, 0.2, 1);
      font-family: 'Inter', sans-serif;
    }

    .back-button:hover {
      background: rgba(0, 0, 0, 0.8);
      transform: translateY(-2px);
      box-shadow: 0 8px 25px rgba(0, 0, 0, 0.3);
    }

    .back-button.hidden {
      opacity: 0;
      transform: translateY(-20px);
      pointer-events: none;
    }

    /* SVG Icons */
    .icon {
      width: 20px;
      height: 20px;
      fill: currentColor;
    }

    .icon-small {
      width: 16px;
      height: 16px;
      fill: currentColor;
    }

    /* Skip Button Text */
    .skip-text {
      font-size: 0.85rem;
      font-weight: 600;
      color: #ffffff;
      font-family: 'Inter', sans-serif;
      letter-spacing: 0.5px;
      text-shadow: 0 1px 2px rgba(0, 0, 0, 0.3);
    }

    /* Quality and Speed Selectors */
    .control-select {
      background: rgba(255, 255, 255, 0.1);
      color: white;
      border: 1px solid rgba(255, 255, 255, 0.2);
      border-radius: 12px;
      padding: 0.6rem 0.8rem;
      font-size: 0.85rem;
      font-family: 'Inter', sans-serif;
      font-weight: 500;
      backdrop-filter: blur(10px);
      transition: all 0.3s cubic-bezier(0.4, 0, 0.2, 1);
      cursor: pointer;
      min-width: 80px;
      appearance: none;
      -webkit-appearance: none;
      -moz-appearance: none;
      position: relative;
      overflow: hidden;
    }

    .control-select::before {
      content: '';
      position: absolute;
      top: 0;
      left: -100%;
      width: 100%;
      height: 100%;
      background: linear-gradient(90deg, transparent, rgba(255, 255, 255, 0.2), transparent);
      transition: left 0.5s;
      pointer-events: none;
    }

    .control-select:hover::before {
      left: 100%;
    }

    .control-select:hover {
      background: rgba(255, 255, 255, 0.2);
      border-color: rgba(255, 255, 255, 0.3);
      transform: translateY(-2px);
      box-shadow: 0 8px 25px rgba(0, 0, 0, 0.3);
    }

    .control-select:focus {
      outline: none;
      background: rgba(255, 255, 255, 0.15);
      border-color: rgba(102, 126, 234, 0.5);
      box-shadow: 0 0 0 3px rgba(102, 126, 234, 0.2);
    }

    .control-select option {
      background: rgba(0, 0, 0, 0.9);
      color: white;
      padding: 0.5rem;
      font-family: 'Inter', sans-serif;
    }

    /* Dropdown Arrow */
    .control-select {
      background-image: url("data:image/svg+xml;charset=UTF-8,%3csvg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 24 24' fill='none' stroke='white' stroke-width='2' stroke-linecap='round' stroke-linejoin='round'%3e%3cpolyline points='6,9 12,15 18,9'%3e%3c/polyline%3e%3c/svg%3e");
      background-repeat: no-repeat;
      background-position: right 0.8rem center;
      background-size: 16px;
      padding-right: 2.5rem;
    }

    /* Fullscreen Styles */
    body.fullscreen-mode {
      cursor: none;
    }

    body.fullscreen-mode.show-cursor {
      cursor: default;
    }

    /* Loading Animation */
    .loading {
      position: absolute;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%);
      z-index: 5;
    }

    .loading-spinner {
      width: 40px;
      height: 40px;
      border: 3px solid rgba(255, 255, 255, 0.3);
      border-top: 3px solid #667eea;
      border-radius: 50%;
      animation: spin 1s linear infinite;
    }

    @keyframes spin {
      0% {
        transform: rotate(0deg);
      }

      100% {
        transform: rotate(360deg);
      }
    }

    /* Mobile Responsive */
    @media (max-width: 768px) {
      .controls {
        padding: 0.75rem 1rem;
        flex-wrap: wrap;
        gap: 0.5rem;
      }

      .controls-left,
      .controls-right {
        gap: 0.5rem;
        flex: 1;
        min-width: 0;
      }

      .controls-left {
        justify-content: flex-start;
      }

      .controls-right {
        justify-content: flex-end;
      }

      .time {
        font-size: 0.8rem;
        min-width: 100px;
        padding: 0.3rem 0.6rem;
        order: 3;
        flex-basis: 100%;
        text-align: center;
        margin-top: 0.5rem;
      }

      .play-pause-btn {
        width: 2.75rem;
        height: 2.75rem;
      }

      .control-btn {
        padding: 0.5rem;
        height: 2.5rem;
        width: 2.5rem;
      }

      .control-btn .skip-text {
        font-size: 0.75rem;
      }

      .control-select {
        font-size: 0.75rem;
        padding: 0.4rem 1.8rem 0.4rem 0.6rem;
        min-width: 65px;
        height: 2.5rem;
        background-size: 14px;
        background-position: right 0.6rem center;
      }

      .control-select {
        font-size: 0.8rem;
        padding: 0.5rem 0.6rem;
        min-width: 70px;
        padding-right: 2.2rem;
      }

      .progress-container {
        left: 1rem;
        right: 1rem;
        bottom: 6rem;
      }

      .progress-container:hover {
        bottom: 5.9rem;
      }

      .back-button {
        top: 1rem;
        left: 1rem;
        padding: 0.6rem 1rem;
        font-size: 0.85rem;
      }

      .icon {
        width: 18px;
        height: 18px;
      }

      .icon-small {
        width: 14px;
        height: 14px;
      }
    }

    /* Extra Small Mobile Devices */
    @media (max-width: 480px) {
      .controls {
        padding: 0.5rem 0.75rem;
      }

      .controls-left,
      .controls-right {
        gap: 0.4rem;
      }

      .play-pause-btn {
        width: 2.5rem;
        height: 2.5rem;
      }

      .control-btn {
        height: 2.25rem;
        width: 2.25rem;
        padding: 0.4rem;
      }

      .control-select {
        font-size: 0.7rem;
        padding: 0.35rem 1.6rem 0.35rem 0.5rem;
        min-width: 60px;
        height: 2.25rem;
        background-size: 12px;
        background-position: right 0.5rem center;
      }

      .time {
        font-size: 0.75rem;
        min-width: 90px;
        padding: 0.25rem 0.5rem;
      }

      .back-button {
        padding: 0.5rem 0.75rem;
        font-size: 0.8rem;
      }

      .progress-container {
        left: 0.75rem;
        right: 0.75rem;
        bottom: 5.5rem;
      }

      .progress-container:hover {
        bottom: 5.4rem;
      }
    }

    /* Landscape Mode Styles for Mobile */
    @media screen and (orientation: landscape) and (max-height: 500px) {
      .controls {
        padding: 0.5rem 1rem;
        flex-wrap: nowrap;
      }

      .time {
        order: 0;
        flex-basis: auto;
        margin-top: 0;
        font-size: 0.75rem;
        min-width: 100px;
        padding: 0.3rem 0.6rem;
      }

      .progress-container {
        bottom: 3.5rem;
      }

      .progress-container:hover {
        bottom: 3.4rem;
      }

      .back-button {
        top: 0.75rem;
        left: 0.75rem;
        padding: 0.5rem 0.75rem;
        font-size: 0.8rem;
      }

      .play-pause-btn {
        width: 2.5rem;
        height: 2.5rem;
      }

      .control-btn {
        height: 2.25rem;
        width: 2.25rem;
      }

      .control-select {
        font-size: 0.7rem;
        height: 2.25rem;
        min-width: 55px;
      }
    }

    /* Touch-friendly improvements */
    @media (hover: none) and (pointer: coarse) {
      .control-btn,
      .control-select,
      .play-pause-btn {
        min-height: 44px;
        min-width: 44px;
      }

      .progress-container {
        height: 8px;
        padding: 8px 0;
      }

      .progress-bar {
        height: 8px;
      }

      .progress-handle {
        width: 20px;
        height: 20px;
        right: -10px;
        opacity: 1;
      }

      .control-select {
        padding: 0.6rem 2rem 0.6rem 0.8rem;
      }
    }

    /* Very small screens */
    @media (max-width: 360px) {
      .controls-left,
      .controls-right {
        gap: 0.3rem;
      }

      .control-select {
        min-width: 50px;
        font-size: 0.65rem;
      }

      .time {
        font-size: 0.7rem;
        min-width: 80px;
      }
    }

    /* Animations */
    @keyframes fadeIn {
      from {
        opacity: 0;
        transform: translateY(20px);
      }

      to {
        opacity: 1;
        transform: translateY(0);
      }
    }

    .controls {
      animation: fadeIn 0.4s cubic-bezier(0.4, 0, 0.2, 1);
    }

    /* Custom Scrollbar (if needed) */
    ::-webkit-scrollbar {
      width: 8px;
    }

    ::-webkit-scrollbar-track {
      background: rgba(255, 255, 255, 0.1);
    }

    ::-webkit-scrollbar-thumb {
      background: rgba(255, 255, 255, 0.3);
      border-radius: 4px;
    }

    ::-webkit-scrollbar-thumb:hover {
      background: rgba(255, 255, 255, 0.5);
    }
  </style>
</head>
